import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
import Icon from "@material-ui/core/Icon";
// core components
import Card from "components/Card/Card.js";
import CardHeader from "components/Card/CardHeader.js";
import CardBody from "components/Card/CardBody.js";
import GridItem from "components/Grid/GridItem.js";
import GridContainer from "components/Grid/GridContainer.js";
import Button from "components/CustomButtons/Button.js";
import CardIcon from "components/Card/CardIcon.js";
import CropFree from "@material-ui/icons/CropFree";
import Edit from "@material-ui/icons/Edit";
import Store from "@material-ui/icons/Store";
import ReportProblem from "@material-ui/icons/ReportProblem";
import SupervisorAccount from "@material-ui/icons/SupervisorAccount";
import LocationOn from "@material-ui/icons/LocationOn";

import styles from "assets/jss/material-dashboard-react/views/dashboardStyle.js";


const useStyles = makeStyles(styles);

export default function Functions() {
  const classes = useStyles();
  return (
      <GridContainer>
          <GridItem xs={12} sm={12} md={4}>
            <Card>
              <CardHeader color="info" stats icon>
                <CardIcon color="info">
                  <CropFree/>
                </CardIcon>
                <p className={classes.cardCategory}>Manage QR Codes</p>
                <h5 className={classes.cardTitle}>Add/Remove/Edit QR here!</h5>
              </CardHeader>
              <CardBody>
                <Button fullWidth color="success">View</Button> 
              </CardBody>
            </Card>
          </GridItem>
          <GridItem xs={12} sm={12} md={4}>
            <Card>
              <CardHeader color="warning" stats icon>
                <CardIcon color="warning">
                  <Store/>
                </CardIcon>
                <p className={classes.cardCategory}>Manage Stores</p>
                <h5 className={classes.cardTitle}>Add/Remove/Edit stores here!</h5>
              </CardHeader>
              <CardBody>
                <Button fullWidth color="success">View</Button> 
              </CardBody>
            </Card>
          </GridItem>
          <GridItem xs={12} sm={12} md={4}>
            <Card>
              <CardHeader color="danger" stats icon>
                <CardIcon color="danger">
                  <ReportProblem/>
                </CardIcon>
                <p className={classes.cardCategory}>Manage Faults</p>
                <h5 className={classes.cardTitle}>Add/Remove/Edit Faults here!</h5>
              </CardHeader>
              <CardBody>
                <Button fullWidth color="success">View</Button> 
              </CardBody>
            </Card>
          </GridItem>
          <GridItem xs={12} sm={12} md={4}>
            <Card>
              <CardHeader color="info" stats icon>
                <CardIcon color="info">
                  <SupervisorAccount/>
                </CardIcon>
                <p className={classes.cardCategory}>Manage Accounts</p>
                <h5 className={classes.cardTitle}>Add/Remove/Edit Accounts here!</h5>
              </CardHeader>
              <CardBody>
                <Button fullWidth color="success">View</Button> 
              </CardBody>
            </Card>
          </GridItem>
      </GridContainer>
  );
}
